#home_xy_position:150,150
#speed:100
#z_hop:10
#z_hop_speed:10



[quad_gantry_level]
gantry_corners:
   -60,-10
   360,370
  ##Probe points
points:
   50,10
   50,250
   250,250
   250,10


#--------------------------------------------------------------------
speed: 1000
horizontal_move_z: 10
retries: 5
retry_tolerance: 0.0075
max_adjust: 10


